import React from "react";
import Layout from "../components/Layout";
import axios from "axios";

import { Container, Row, Col } from "reactstrap";

class News extends React.Component {

    constructor(props) {
    super(props);
    this.state = {};
  }

  render() {
    return (
      <Layout page="article">
        <Container>News</Container>
      </Layout>
    );
  }
}

export default News;
